    useEffect(() => {
        console.log("useEffect");
    }, [props.tweetList]);
    console.log(tweetList);
    return <div className="tweet-list">
        {props.tweetList.map((item, index) => { return <TweetItem key={index} pic={item.picture} username={item.username} content={item.tweetData} /> })}
    </div>
}

const mapStateToProps = (state) => {
